import React from 'react'
import {Input} from 'antd'

const {Search}  = Input;

function SearchFeature() {
  return (
    <div>
          <Search placeholder="input search text" onSearch={onSearch} style={{ width: 200 }} />

    </div>
  )
}

export default SearchFeature
